import React from "react";
import paradiseImage from "../assets/tree_and_canoe.png";

function Paradise() {
  return (
    <>
      <div className='paradise'>
        <div className='paradise__find'>
          <h3 className='paradise__find--heading'>Find Your Stay</h3>
          <div className='paradise__find--tropicana'></div>
        </div>

        <div
          style={{
            backgroundImage: `url(${paradiseImage})`,
            width: "849px",
            height: "621px",
            marginTop: "10rem",
          }}
        ></div>
      </div>
    </>
  );
}

export default Paradise;
